<script>
import AtomWrapper from '../../atoms/AtomWrapper'
import ButtonArrow from '../../atoms/ButtonArrow/button-arrow.vue'
export default {
  name: 'NoelFrame',
  components: { AtomWrapper, ButtonArrow },
  props: {
    index: {
      type: Number,
      required: true,
    },
    withoutLongBall: {
      type: Boolean,
      default: false,
    },
    withoutBalls: {
      type: Boolean,
      default: false,
    },
  },
  mounted() {
    this.$gsap
      .timeline()
      .addLabel('start', 0)
      .to(
        [...this.$refs.frame.querySelectorAll('[id^=dangling]')],
        {
          rotate: 'random(-32, 32)',
          transformOrigin: 'top center',
          repeat: -1,
          repeatRefresh: true,
          yoyo: true,
          stagger: 0.2,
          duration: 0.8,
          ease: 'circ.in',
        },
        'start'
      )
      .to(
        [...this.$refs.frame.querySelectorAll('[id^=scaling]')],
        {
          scale: 'random(0.64, 1.28)',
          transformOrigin: 'center center',
          repeat: -1,
          repeatRefresh: true,
          yoyo: true,
          duration: 0.8,
          ease: 'circ.in',
        },
        'start'
      )
  },
  methods: {
    scrollLeft() {
      this.$emit('left', { index: this.index })
    },
    scrollRight() {
      this.$emit('right', { index: this.index })
    },
  },
}
</script>

